import React from 'react';
import './Burger.css';

class Burger extends React.Component{
  constructor(){
    super();
    this.state = {
      lettuce: 0,
      bacon: 0,
      cheese: 0,
      meat: 0
    };
  }

  render(){
    return(
      <>
        burger!;
      </>
    );
  }
}
export default Burger;
